import CustomButton from "./customButton";

function Todo(props) {
  return (
    <div className="square-style">
      {props.todo.title}- {props.todo.body}
      <CustomButton
        color=" brown"
        onClick={() => props.handleDelete(props.todo.id)}
      >
        delete
      </CustomButton>
      <CustomButton
        color=" rgb(93, 39, 0)"
        onClick={() => props.handleDelete(props.todo.id)}
      >
        complete
      </CustomButton>
    </div>
  );
}

export default Todo;
